import "./App.css";

function App() {
  return (
    <div class="min-w-screen min-h-screen bg-black flex items-center justify-center px-5 pt-5 pb-24">

      <input type="text" placeholder="Insert your name here" class="px-3 py-4 text-blueGray-600 relative bg-white rounded-2xl border-2 border-red-500 focus:border-blue-500 outline-none focus:outline-none focus:ring w-1/2"/>
    </div>
  );
}

export default App;
